export enum CustomMeshTypes { Player, Puck, Bumper };

export class MeshData
{
	public readonly name: string;
	public readonly positions: number[];
	public readonly indices: number[];
	public readonly normals: number[];
	public readonly tangents: number[];
	public readonly uvs: number[];

	public constructor(_data: any)
	{
		this.name = _data.name;
		this.positions = _data.positions;
		this.indices = _data.indices;
		this.normals = _data.normals;
		this.tangents = _data.tangents;
		this.uvs = _data.uvs;
	}
}

export function getMeshData(_meshType: CustomMeshTypes) : MeshData
{
	let data: object = {};
	switch (_meshType)
	{
		case CustomMeshTypes.Player:
			data = getPlayerMeshData();
			break;
		case CustomMeshTypes.Puck:
			data = getPuckMeshData();
			break;
		case CustomMeshTypes.Bumper:
			data = getBumperMeshData();
			break;
		default:
			console.log("No Defined Return in getMeshData() For " + _meshType);
			break;
	}
	return new MeshData(data);
}

